function Shift() {
  return (
    <div
      className="col-4 shadow rounded"
      style={{
        height: "70px",
        boxShadow: "0px 0px 15px -2px 	#B0B0B0",
        borderRadius: "15px",
      }}
    ></div>
  );
}
export default Shift;
